    const filteredItems = CrecheUserx.filter(item => item.name === 'Creche3');
      
          return ( 
          <div className="w-full grid xs:grid-cols-2 ">
                 {filteredItems.map(item => (
         
         <CrecheCard key={item.key}  name={item.name} Location={item.Location} Description={item.Description}  />
       ))}
          </div>
                
    
              );
            };

  return (
   <button onClick={handleClick}>Say hello to {name}</button>
  );
};

